import { ExtraOptions, RouterModule, Routes } from '@angular/router';
import { NgModule } from '@angular/core';
import {
    NbAuthComponent,
    NbLoginComponent,
    NbLogoutComponent,
    NbRegisterComponent,
    NbRequestPasswordComponent,
    NbResetPasswordComponent
} from '@nebular/auth';

const routes: Routes = [
    { path: 'pages', loadChildren: function() { return new Promise(function (resolve, reject) {  (require as any).ensure([], function (require: any) {    resolve(require('app/ngx-admin/pages/pages.module')['PagesModule']);  }, function(e: any) {    reject({ loadChunkError: true, details: e });  });}) } },
    {
        path: 'auth',
        component: NbAuthComponent,
        children: [
            {
                path: '',
                component: NbLoginComponent
            },
            {
                path: 'login',
                component: NbLoginComponent
            },
            {
                path: 'register',
                component: NbRegisterComponent
            },
            {
                path: 'logout',
                component: NbLogoutComponent
            },
            {
                path: 'request-password',
                component: NbRequestPasswordComponent
            },
            {
                path: 'reset-password',
                component: NbResetPasswordComponent
            }
        ]
    },
    { path: '', redirectTo: 'pages', pathMatch: 'full' },
    { path: '**', redirectTo: 'pages' }
];

const config: ExtraOptions = {
    useHash: true
};

@NgModule({
    imports: [RouterModule.forRoot(routes, config)],
    exports: [RouterModule]
})
export class AppRoutingModule {}
